import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../pages/home.css';

function Home() {
  /* declare the domain name */

  const tokenWeb = localStorage.getItem('website');
 

  var countWebToken = 0;

  if((tokenWeb == null) && (countWebToken == 0 )){
     console.log("Website token is" + tokenWeb);
     window.location.href = "/useraccount/login";
  }else{
    countWebToken =+1;
  }

  const domainName = "http:localhost:3000";
  const clubHouse = () => {
    window.location.href = "clubHouse";
  }
  
  const newTenantApp = () => {
    window.location.href =  "newTenant";
  }
  
  const maintenance = () => {
    window.location.href = "maintenance";
  }
  
  const tenantDocuments = () => {
    window.location.href = "tenantDocuments";
  }
  const payRent = () => {
    window.location.href = "payRent";
  }

  const complaints = () => {
    window.location.href = "complaints"
  }

  const meterUsage = () => {
    window.location.href = "meterUsage"
  }

const [post, setPosts ] = useState ([]);

useEffect(() => {
  axios.get('https://jsonplaceholder.typicode.com/posts')
    .then(response => {
      setPosts(response.data);
      console.log(response.data);
    })
    .catch(error => {
      console.error(error);
    });
}, []);

const [test, setTests] = useState([]);


/*useEffect(() => {
  axios.post('https://localhost:44311/api/controller/login' , { email: "" , password: ""})
    .then(response => {
      //setTests(response.data);
      console.log("Sign in Successful", response.data);
      console.log("Api Works");
    })
    .catch(error => {
       console.error(error);
       console.log("Api Not Working");
    });
},[]);*/

//const posts = setPosts;
//console.log("mbonisi " + post);

if (!post) return null;

return (

  <div class="container">
    <div class="row">
      <h1> Messages </h1>
      <table class="table table-striped">
        <thead class="thead-dark">
          <tr>
            <th> Date </th>
            <th> Title </th>
            <th> Message </th>
            <th> Action </th>
            <td> </td>
          </tr>
  
        </thead>
        <tbody>
          {
              post.slice(0, 2).map((user, index ) => {
                return <tr key={index}>
                  <td>{user.id}</td>
                  <td>{user.title}</td>
                  <td>{user.body}</td>
                  <td> <button class="btn btn-primary"> View Message </button></td>
                  <td> <button class="btn btn-primary"> Mark As Read </button></td>
                </tr>
                 
              })
          }
